import React from 'react';

const RateButtons = () => {
  return (
    <div class="extra content">
      <div class="ui two buttons">
        <div class="ui basic green button">Cool</div>
        <div class="ui basic red button">Gruel</div>
      </div>
    </div>
  );
};

export default RateButtons;
